import LOGO_FINAL_KALYPSE_H from "./components/landing/uploads_k/LOGO-FINAL-KALYPSE-H.png";
import { BrowserRouter, Route, Link } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div>
        <p>
          Orientación Laboral y puesta en contacto con empresas del sector: Cv y
          LinkedIn De cara a diseñar el taller de Paola Salanueva y el feedback
          individual que os dará tras el taller necesitamos vuestros CV y
          enlaces a LinkedIn. Os pido por favor que enviéis un mail a
          marta@code4jobs.com antes del viernes que viene (16 de Octubre) con:
          el enlace a vuestra cuenta de LinkedIn. si tenéis, vuestro CV
          "clásico"(el de papel de toda la vida vaya) en el adjunto. No importa
          si no está actualizado a fecha de hoy.
        </p>
      </div>
      <div>
        <img src={LOGO_FINAL_KALYPSE_H} alt="Kalypse" className="img_hero" />
      </div>
    </BrowserRouter>
  );
}

export default App;
